var title_f5_32_5642="Functional anatomy of the finger";
var content_f5_32_5642=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F51038&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F51038&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 611px\">",
"   <div class=\"ttl\">",
"    Functional anatomy of the finger",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 591px; height: 750px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Dorsal \"hood\" and extensor expansion of the 3rd digit. Lateral (A) and posterior (B) views of the dorsal \"hood\" and extensor expansion. Observe the interosseous muscles inserted in part into the base of the proximal phalanx and in part into the extensor expansion and the lumbrical muscle, which inserts into the radial side of the extensor expansion. (C-D) Lateral views of the extensor expansion in extension. The extensor expansion is a delicate fibrous band that runs from the proximal phalanx and fibrous digital sheath obliquely across the middle phalanx and two interphalangeal joints to join the dorsal \"hood\" to the distal phalanx. (E) Lateral view of the finger in flexion. On flexing the distal interphalangeal joint (C), the extensor expansion (particularly its lateral bands) becomes taut, pulling the proximal joint into flexion (E). Similarly, on flexing the metacarpophalangeal joint, the proximal and distal joints are pulled by the extensor expansions (lateral bands) into nearly complete extension.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Moore KL, PhD, FRSM, FIAC &amp; Dalley AF II, PhD. Clinical Oriented Anatomy (4th ed). Baltimore, Lippincott Williams &amp; Wilkins 1999. Copyright &copy; 1999 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
